As a useful tool to yourself, you can insert a // TODO comment for something that you want to get back to before you land your PR: fn do_something() { if something_else { unimplemented!(); // TODO write this }
} The tidy script will report an error for a // TODO comment, so this code would not be able to land until the TODO is fixed (or removed). This can also be useful in a PR as a way to signal from one commit that you are leaving a bug that a later commit will fix: if foo { return true; // TODO wrong, but will be fixed in a later commit
}

