So you may be wondering what happens when you invoke a query method. The answer is that, for each query, the compiler maintains a cache – if your query has already been executed, then, the answer is simple: we clone the return value out of the cache and return it (therefore, you should try to ensure that the return types of queries are cheaply cloneable; insert a Rc if necessary). Providers If, however, the query is not in the cache, then the compiler will try to find a suitable provider . A provider is a function that has been defined and linked into the compiler somewhere that contains the code to compute the result of the query. Providers are defined per-crate. The compiler maintains, internally, a table of providers for every crate, at least conceptually. Right now, there are really two sets: the providers for queries about the local crate (that is, the one being compiled) and providers for queries about external crates (that is, dependencies of the local crate). Note that what determines the crate that a query is targeting is not the kind of query, but the key . For example, when you invoke tcx.type_of(def_id), that could be a local query or an external query, depending on what crate the def_id is referring to (see the self::keys::Key trait for more information on how that works). Providers always have the same signature: fn provider<'tcx>( tcx: TyCtxt<'tcx>, key: QUERY_KEY,
) -> QUERY_RESULT { ...
} Providers take two arguments: the tcx and the query key. They return the result of the query. How providers are setup When the tcx is created, it is given the providers by its creator using the Providers struct. This struct is generated by the macros here, but it is basically a big list of function pointers: struct Providers { type_of: for<'tcx> fn(TyCtxt<'tcx>, DefId) -> Ty<'tcx>, ...
} At present, we have one copy of the struct for local crates, and one for external crates, though the plan is that we may eventually have one per crate. These Provider structs are ultimately created and populated by librustc_driver, but it does this by distributing the work throughout the other rustc_* crates. This is done by invoking various provide functions. These functions tend to look something like this: pub fn provide(providers: &mut Providers) { *providers = Providers { type_of, ..*providers };
} That is, they take an &mut Providers and mutate it in place. Usually we use the formulation above just because it looks nice, but you could as well do providers.type_of = type_of, which would be equivalent. (Here, type_of would be a top-level function, defined as we saw before.) So, if we want to add a provider for some other query, let's call it fubar, into the crate above, we might modify the provide() function like so: pub fn provide(providers: &mut Providers) { *providers = Providers { type_of, fubar, ..*providers };
} fn fubar<'tcx>(tcx: TyCtxt<'tcx>, key: DefId) -> Fubar<'tcx> { ... } N.B. Most of the rustc_* crates only provide local providers . Almost all extern providers wind up going through the rustc_metadata crate , which loads the information from the crate metadata. But in some cases there are crates that provide queries for both local and external crates, in which case they define both a provide and a provide_extern function that rustc_driver can invoke.

