So suppose you want to add a new kind of query, how do you do so? Well, defining a query takes place in two steps: first, you have to specify the query name and arguments; and then, you have to supply query providers where needed. To specify the query name and arguments, you simply add an entry to the big macro invocation in src/librustc/query/mod.rs , which looks something like: rustc_queries! { Other { /// Records the type of every item. query type_of(key: DefId) -> Ty<'tcx> { cache { key.is_local() } } } ...
} Queries are grouped into categories (Other, Codegen, TypeChecking, etc.). Each group contains one or more queries. Each query definition is broken up like this: query type_of(key: DefId) -> Ty<'tcx> { ... }
^^ ^^^^^^^ ^^^^^ ^^^^^^^^ ^^^
| | | | |
| | | | query modifiers
| | | result type of query
| | query key type
| name of query
query keyword Let's go over them one by one: Query keyword: indicates a start of a query definition. Name of query: the name of the query method (tcx.type_of(..)). Also used as the name of a struct (ty::queries::type_of) that will be generated to represent this query. Query key type: the type of the argument to this query. This type must implement the ty::query::keys::Key trait, which defines (for example) how to map it to a crate, and so forth. Result type of query: the type produced by this query. This type should (a) not use RefCell or other interior mutability and (b) be cheaply cloneable. Interning or using Rc or Arc is recommended for non-trivial data types. The one exception to those rules is the ty::steal::Steal type, which is used to cheaply modify MIR in place. See the definition of Steal for more details. New uses of Steal should not be added without alerting @rust-lang/compiler. Query modifiers: various flags and options that customize how the query is processed. So, to add a query: Add an entry to rustc_queries! using the format above. Link the provider by modifying the appropriate provide method; or add a new one if needed and ensure that rustc_driver is invoking it. Query structs and descriptions For each kind, the rustc_queries macro will generate a "query struct" named after the query. This struct is a kind of a place-holder describing the query. Each such struct implements the self::config::QueryConfig trait, which has associated types for the key/value of that particular query. Basically the code generated looks something like this: // Dummy struct representing a particular kind of query:
pub struct type_of<'tcx> { data: PhantomData<&'tcx ()> } impl<'tcx> QueryConfig for type_of<'tcx> { type Key = DefId; type Value = Ty<'tcx>; const NAME: QueryName = QueryName::type_of; const CATEGORY: ProfileCategory = ProfileCategory::Other;
} There is an additional trait that you may wish to implement called self::config::QueryDescription. This trait is used during cycle errors to give a "human readable" name for the query, so that we can summarize what was happening when the cycle occurred. Implementing this trait is optional if the query key is DefId, but if you don't implement it, you get a pretty generic error ("processing foo..."). You can put new impls into the config module. They look something like this: impl<'tcx> QueryDescription for queries::type_of<'tcx> { fn describe(tcx: TyCtxt, key: DefId) -> String { format!("computing the type of `{}`", tcx.def_path_str(key)) }
} Another option is to add desc modifier: rustc_queries! { Other { /// Records the type of every item. query type_of(key: DefId) -> Ty<'tcx> { desc { |tcx| "computing the type of `{}`", tcx.def_path_str(key) } } }
} rustc_queries macro will generate an appropriate impl automatically.

