The "false positives" problem can be solved by interleaving change detection and query re-evaluation. Instead of walking the graph all the way to the inputs when trying to find out if some cached result is still valid, we can check if a result has actually changed after we were forced to re-evaluate it. We call this algorithm, for better or worse, the red-green algorithm because nodes in the dependency graph are assigned the color green if we were able to prove that its cached result is still valid and the color red if the result has turned out to be different after re-evaluating it. The meat of red-green change tracking is implemented in the try-mark-green algorithm, that, you've guessed it, tries to mark a given node as green: fn try_mark_green(tcx, current_node) -> bool { // Fetch the inputs to `current_node`, i.e. get the nodes that the direct // edges from `node` lead to. let dependencies = tcx.dep_graph.get_dependencies_of(current_node); // Now check all the inputs for changes for dependency in dependencies { match tcx.dep_graph.get_node_color(dependency) { Green => { // This input has already been checked before and it has not // changed; so we can go on to check the next one } Red => { // We found an input that has changed. We cannot mark // `current_node` as green without re-running the // corresponding query. return false } Unknown => { // This is the first time we are look at this node. Let's try // to mark it green by calling try_mark_green() recursively. if try_mark_green(tcx, dependency) { // We successfully marked the input as green, on to the // next. } else { // We could *not* mark the input as green. This means we // don't know if its value has changed. In order to find // out, we re-run the corresponding query now! tcx.run_query_for(dependency); // Fetch and check the node color again. Running the query // has forced it to either red (if it yielded a different // result than we have in the cache) or green (if it // yielded the same result). match tcx.dep_graph.get_node_color(dependency) { Red => { // The input turned out to be red, so we cannot // mark `current_node` as green. return false } Green => { // Re-running the query paid off! The result is the // same as before, so this particular input does // not invalidate `current_node`. } Unknown => { // There is no way a node has no color after // re-running the query. panic!("unreachable") } } } } } } // If we have gotten through the entire loop, it means that all inputs // have turned out to be green. If all inputs are unchanged, it means // that the query result corresponding to `current_node` cannot have // changed either. tcx.dep_graph.mark_green(current_node); true
} // Note: The actual implementation can be found in
// src/librustc/dep_graph/graph.rs By using red-green marking we can avoid the devastating cumulative effect of having false positives during change detection. Whenever a query is executed in incremental mode, we first check if its already green. If not, we run try_mark_green() on it. If it still isn't green after that, then we actually invoke the query provider to re-compute the result.

