One of the first observations is that the Rust trait system is basically a kind of logic. As such, we can map our struct, trait, and impl declarations into logical inference rules. For the most part, these are basically Horn clauses, though we'll see that to capture the full richness of Rust – and in particular to support generic programming – we have to go a bit further than standard Horn clauses. To see how this mapping works, let's start with an example. Imagine we declare a trait and a few impls, like so: trait Clone { }
impl Clone for usize { }
impl<T> Clone for Vec<T> where T: Clone { } We could map these declarations to some Horn clauses, written in a Prolog-like notation, as follows: Clone(usize).
Clone(Vec<?T>) :- Clone(?T). // The notation `A :- B` means "A is true if B is true".
// Or, put another way, B implies A. In Prolog terms, we might say that Clone(Foo) – where Foo is some Rust type – is a predicate that represents the idea that the type Foo implements Clone. These rules are program clauses ; they state the conditions under which that predicate can be proven (i.e., considered true). So the first rule just says "Clone is implemented for usize". The next rule says "for any type ?T, Clone is implemented for Vec<?T> if clone is implemented for ?T". So e.g. if we wanted to prove that Clone(Vec<Vec<usize>>), we would do so by applying the rules recursively: Clone(Vec<Vec<usize>>) is provable if: Clone(Vec<usize>) is provable if: Clone(usize) is provable. (Which it is, so we're all good.) But now suppose we tried to prove that Clone(Vec<Bar>). This would fail (after all, I didn't give an impl of Clone for Bar): Clone(Vec<Bar>) is provable if: Clone(Bar) is provable. (But it is not, as there are no applicable rules.) We can easily extend the example above to cover generic traits with more than one input type. So imagine the Eq<T> trait, which declares that Self is equatable with a value of type T: trait Eq<T> { ... }
impl Eq<usize> for usize { }
impl<T: Eq<U>> Eq<Vec<U>> for Vec<T> { } That could be mapped as follows: Eq(usize, usize).
Eq(Vec<?T>, Vec<?U>) :- Eq(?T, ?U). So far so good.

