Let's work through an example query to see what all the parts mean. Consider the Borrow trait . This trait has a number of impls; among them, there are these two (for clarity, I've written the Sized bounds explicitly): impl<T> Borrow<T> for T where T: ?Sized
impl<T> Borrow<[T]> for Vec<T> where T: Sized Example 1. Imagine we are type-checking this (rather artificial) bit of code: fn foo<A, B>(a: A, vec_b: Option<B>) where A: Borrow<B> { } fn main() { let mut t: Vec<_> = vec![]; // Type: Vec<?T> let mut u: Option<_> = None; // Type: Option<?U> foo(t, u); // Example 1: requires `Vec<?T>: Borrow<?U>` ...
} As the comments indicate, we first create two variables t and u; t is an empty vector and u is a None option. Both of these variables have unbound inference variables in their type: ?T represents the elements in the vector t and ?U represents the value stored in the option u. Next, we invoke foo; comparing the signature of foo to its arguments, we wind up with A = Vec<?T> and B = ?U. Therefore, the where clause on foo requires that Vec<?T>: Borrow<?U>. This is thus our first example trait query. There are many possible solutions to the query Vec<?T>: Borrow<?U>; for example: ?U = Vec<?T>, ?U = [?T], ?T = u32, ?U = [u32] and so forth. Therefore, the result we get back would be as follows (I'm going to ignore region constraints and the "value"): Certainty: Ambiguous – we're not sure yet if this holds Var values: [?T = ?T, ?U = ?U] – we learned nothing about the values of the variables In short, the query result says that it is too soon to say much about whether this trait is proven. During type-checking, this is not an immediate error: instead, the type checker would hold on to this requirement (Vec<?T>: Borrow<?U>) and wait. As we'll see in the next example, it may happen that ?T and ?U wind up constrained from other sources, in which case we can try the trait query again. Example 2. We can now extend our previous example a bit, and assign a value to u: fn foo<A, B>(a: A, vec_b: Option<B>) where A: Borrow<B> { } fn main() { // What we saw before: let mut t: Vec<_> = vec![]; // Type: Vec<?T> let mut u: Option<_> = None; // Type: Option<?U> foo(t, u); // `Vec<?T>: Borrow<?U>` => ambiguous // New stuff: u = Some(vec![]); // ?U = Vec<?V>
} As a result of this assignment, the type of u is forced to be Option<Vec<?V>>, where ?V represents the element type of the vector. This in turn implies that ?U is unified to Vec<?V>. Let's suppose that the type checker decides to revisit the "as-yet-unproven" trait obligation we saw before, Vec<?T>: Borrow<?U>. ?U is no longer an unbound inference variable; it now has a value, Vec<?V>. So, if we "refresh" the query with that value, we get: Vec<?T>: Borrow<Vec<?V>> This time, there is only one impl that applies, the reflexive impl: impl<T> Borrow<T> for T where T: ?Sized Therefore, the trait checker will answer: Certainty: Proven Var values: [?T = ?T, ?V = ?T] Here, it is saying that we have indeed proven that the obligation holds, and we also know that ?T and ?V are the same type (but we don't know what that type is yet!). (In fact, as the function ends here, the type checker would give an error at this point, since the element types of t and u are still not yet known, even though they are known to be the same.)

