As discussed in the parent section , most trait queries wind up with a result that brings together a "certainty value" certainty, a result substitution var_values, and some region constraints. To create this, we wind up re-using the substitution S that we created when first instantiating our query. To refresh your memory, we had a query for<T,L,T> { ?0: Foo<'?1, ?2> } for which we made a substutition S: S = [?A, '?B, ?C] We then did some work which unified some of those variables with other things. If we "refresh" S with the latest results, we get: S = [Vec<?E>, '?D, ?E] These are precisely the new values for the three input variables from our original query. Note though that they include some new variables (like ?E). We can make those go away by canonicalizing again! We don't just canonicalize S, though, we canonicalize the whole query response QR: QR = { certainty: Proven, // or whatever var_values: [Vec<?E>, '?D, ?E] // this is S region_constraints: [?E: '?D], // from the impl value: (), // for our purposes, just (), but // in some cases this might have // a type or other info
} The result would be as follows: Canonical(QR) = for<T, L> { certainty: Proven, var_values: [Vec<?0>, '?1, ?0] region_constraints: [?0: '?1], value: (),
} (One subtle point: when we canonicalize the query result , we do not use any special treatment for free lifetimes. Note that both references to '?D, for example, were converted into the same canonical variable (?1). This is in contrast to the original query, where we canonicalized every free lifetime into a fresh canonical variable.) Now, this result must be reapplied in each context where needed.

