From time to time we have to reason about regions that we can't concretely know. For example, consider this program: // A function that needs a static reference
fn foo(x: &'static u32) { } fn bar(f: for<'a> fn(&'a u32)) { // ^^^^^^^^^^^^^^^^^^^ a function that can accept **any** reference let x = 22; f(&x);
} fn main() { bar(foo);
} This program ought not to type-check: foo needs a static reference for its argument, and bar wants to be given a function that that accepts any reference (so it can call it with something on its stack, for example). But how do we reject it and why ?

