OK, so far so good. Now let's walk through what would happen with our first example: fn(&'static u32) <: fn(&'!1 u32) @ P // this point P is not imp't here The region inference engine will create a region element domain like this: { CFG; end('static); placeholder(1) } --- ------------ ------- from the universe `!1` | 'static is always in scope all points in the CFG; not especially relevant here It will always create two universal variables, one representing 'static and one representing '!1. Let's call them Vs and V1. They will have initial values like so: Vs = { CFG; end('static) } // it is in U0, so can't name anything else
V1 = { placeholder(1) } From the subtyping constraint above, we would have an outlives constraint like '!1: 'static @ P To process this, we would grow the value of V1 to include all of Vs: Vs = { CFG; end('static) }
V1 = { CFG; end('static), placeholder(1) } At that point, constraint propagation is complete, because all the outlives relationships are satisfied. Then we would go to the "check universal regions" portion of the code, which would test that no universal region grew too large. In this case, V1 did grow too large – it is not known to outlive end('static), nor any of the CFG – so we would report an error.

