What about this subtyping relationship? for<'a> fn(&'a u32, &'a u32) <:
for<'b, 'c> fn(&'b u32, &'c u32) Here we would replace the bound region in the supertype with a placeholder, as before, yielding: for<'a> fn(&'a u32, &'a u32) <:
fn(&'!1 u32, &'!2 u32) then we instantiate the variable on the left-hand side with an existential in universe U2, yielding the following (?n is a notation for an existential variable): fn(&'?3 u32, &'?3 u32) <:
fn(&'!1 u32, &'!2 u32) Then we break this down further: &'!1 u32 <: &'?3 u32
&'!2 u32 <: &'?3 u32 and even further, yield up our region constraints: '!1: '?3
'!2: '?3 Note that, in this case, both '!1 and '!2 have to outlive the variable '?3, but the variable '?3 is not forced to outlive anything else. Therefore, it simply starts and ends as the empty set of elements, and hence the type-check succeeds here. (This should surprise you a little. It surprised me when I first realized it. We are saying that if we are a fn that needs both of its arguments to have the same region , we can accept being called with arguments with two distinct regions . That seems intuitively unsound. But in fact, it's fine, as I tried to explain in this issue on the Rust issue tracker long ago. The reason is that even if we get called with arguments of two distinct lifetimes, those two lifetimes have some intersection (the call itself), and that intersection can be our value of 'a that we use as the common lifetime of our arguments. -nmatsakis)

