Miri ( MIR I nterpreter) is a virtual machine for executing MIR without compiling to machine code. It is usually invoked via tcx.const_eval. If you start out with a constant const FOO: usize = 1 << 12; rustc doesn't actually invoke anything until the constant is either used or placed into metadata. Once you have a use-site like type Foo = [u8; FOO - 42]; The compiler needs to figure out the length of the array before being able to create items that use the type (locals, constants, function arguments, ...). To obtain the (in this case empty) parameter environment, one can call let param_env = tcx.param_env(length_def_id);. The GlobalId needed is let gid = GlobalId { promoted: None, instance: Instance::mono(length_def_id),
}; Invoking tcx.const_eval(param_env.and(gid)) will now trigger the creation of the MIR of the array length expression. The MIR will look something like this: const Foo::{{initializer}}: usize = { let mut _0: usize; // return pointer let mut _1: (usize, bool); bb0: { _1 = CheckedSub(const Unevaluated(FOO, Slice([])), const 42usize); assert(!(_1.1: bool), "attempt to subtract with overflow") -> bb1; } bb1: { _0 = (_1.0: usize); return; }
} Before the evaluation, a virtual memory location (in this case essentially a vec![u8; 4] or vec![u8; 8]) is created for storing the evaluation result. At the start of the evaluation, _0 and _1 are ConstValue::Scalar(Scalar::Undef). When the initialization of _1 is invoked, the value of the FOO constant is required, and triggers another call to tcx.const_eval, which will not be shown here. If the evaluation of FOO is successful, 42 will be subtracted by its value 4096 and the result stored in _1 as ConstValue::ScalarPair(Scalar::Bytes(4054), Scalar::Bytes(0)). The first part of the pair is the computed value, the second part is a bool that's true if an overflow happened. The next statement asserts that said boolean is 0. In case the assertion fails, its error message is used for reporting a compile-time error. Since it does not fail, ConstValue::Scalar(Scalar::Bytes(4054)) is stored in the virtual memory was allocated before the evaluation. _0 always refers to that location directly. After the evaluation is done, the virtual memory allocation is interned into the TyCtxt. Future evaluations of the same constants will not actually invoke miri, but just extract the value from the interned allocation. The tcx.const_eval function has one additional feature: it will not return a ByRef(interned_allocation_id), but a Scalar(computed_value) if possible. This makes using the result much more convenient, as no further queries need to be executed in order to get at something as simple as a usize.

