The feature I will discuss in this chapter is the ? Kleene operator for macros. Basically, we want to be able to write something like this: macro_rules! foo { ($arg:ident $(, $optional_arg:ident)?) => { println!("{}", $arg); $( println!("{}", $optional_arg); )? }
} fn main() { let x = 0; foo!(x); // ok! prints "0" foo!(x, x); // ok! prints "0 0"
} So basically, the $(pat)? matcher in the macro means "this pattern can occur 0 or 1 times", similar to other regex syntaxes. There were a number of steps to go from an idea to stable rust feature. Here is a quick list. We will go through each of these in order below. As I mentioned before, not all of these are needed for every type of contribution. Idea discussion/Pre-RFC A Pre-RFC is an early draft or design discussion of a feature. This stage is intended to flesh out the design space a bit and get a grasp on the different merits and problems with an idea. It's a great way to get early feedback on your idea before presenting it the wider audience. You can find the original discussion here . RFC This is when you formally present your idea to the community for consideration. You can find the RFC here . Implementation Implement your idea unstabley in the compiler. You can find the original implementation here . Possibly iterate/refine As the community gets experience with your feature on the nightly compiler and in libstd, there may be additional feedback about design choice that might be adjusted. This particular feature went through a number of iterations . Stabilization When your feature has baked enough, a rust team member may propose to stabilize it . If there is consensus, this is done. Relax Your feature is now a stable rust feature!

