Most importantly, remove the code which flags an error if the feature-gate is not present (since the feature is now considered stable). If the feature can be detected because it employs some new syntax, then a common place for that code to be is in the same feature_gate.rs. For example, you might see code like this: gate_feature_post!(&self, pub_restricted, span, "`pub(restricted)` syntax is experimental"); This gate_feature_post! macro prints an error if the pub_restricted feature is not enabled. It is not needed now that #[pub_restricted] is stable. For more subtle features, you may find code like this: if self.tcx.sess.features.borrow().pub_restricted { /* XXX */ } This pub_restricted field (obviously named after the feature) would ordinarily be false if the feature flag is not present and true if it is. So transform the code to assume that the field is true. In this case, that would mean removing the if and leaving just the /* XXX */. if self.tcx.sess.features.borrow().pub_restricted { /* XXX */ }
becomes
/* XXX */ if self.tcx.sess.features.borrow().pub_restricted && something { /* XXX */ } becomes
if something { /* XXX */ }
